import React, { useEffect, useState } from "react";
import { getAllLaunchList } from "./Utility/Services/launch";

const LaunchButton = () => {
  let buttonList = [];
  for (let i = 2006; i <= 2020; i++) {
    buttonList.push(<button className="col-lg-6">{i}</button>);
  }
};
const SpaceLaunchList = () => {
  const [state, setState] = useState({ launchList: [] });
  useEffect(() => {
    getAllLaunchList().then((res) => {
      if (res.error) {
        return;
      }
      if (!res.error) {
        state.launchList = res.data;
        setState({ ...state });
      }
    });
  }, []);
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-lg-4">
            <span>Launch Year</span>
            <div className="row"></div>
          </div>
          <div className="col-lg-8">
            <div className="row">
              {state.launchList.map((res) => {
                return (
                  <div className="col-lg-3 border">
                    <div>
                      {" "}
                      <img src={res.links.mission_patch_small} />{" "}
                    </div>
                    <div> {res.mission_name} </div>
                    <div>
                      {" "}
                      Mission Ids
                      <ul>
                        {" "}
                        {res.mission_id.map((idData) => {
                          return <li>{idData}</li>;
                        })}{" "}
                      </ul>
                    </div>
                    <div>Launch year :{res.launch_year}</div>
                    <div>
                      Successful Launch :{res.launch_success ? "True" : "False"}
                    </div>
                    <div>Successful Landing :{res.launch_year}</div>
                  </div>
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default SpaceLaunchList;
